//App.js

import ChatBot from 'react-simple-chatbot';

const steps = [
	{
		id: '0',
		message: 'Nameste India! Send a text for help! :)',
		end: true
	}
];

function App() {
	return (
		<div className="App">
			<h1>Welcome to eVisaIndia: A Online E-Visa Processing Application</h1>
			<ChatBot steps={steps} />
		</div>
	);
}

export default App;
